import Cookies from "js-cookie";


export const url = {
  URLauthen: "https://foodbackend.logoutwifi.me/login.php"
};

export const accesstoken = () => {
  const jwt = Cookies.get("__session");
  return jwt;
};


export const logOut = () => {
  Cookies.remove("__session");
};
